import { BadRequestException, Injectable, Post } from '@nestjs/common';
import * as fs from 'fs';
import * as path from 'path';

@Injectable()
export class VehicleService {
  private readonly base64Image = ``;
  private readonly imageFileName = 'parking-vehicle.png';
  private readonly imageFilePath = path.resolve(
    './public/images',
    this.imageFileName,
  );

  private saveBase64AsImage(base64: string, fileName: string): void {
    const buffer = Buffer.from(base64, 'base64');
    const directoryPath = path.resolve('./public/images');

    fs.mkdirSync(directoryPath, { recursive: true }); // Ensure the directory exists
    const filePath = path.join(directoryPath, fileName);

    fs.writeFileSync(filePath, buffer); // Save the image
  }

  findParkedVehicle(licensePlate: string) {
    licensePlate = licensePlate.toLowerCase();

    if (licensePlate !== 'abc123') {
      throw new BadRequestException('Invalid License Plate');
    }

    if (!fs.existsSync(this.imageFilePath)) {
      this.saveBase64AsImage(this.base64Image, this.imageFileName);
    }

    // Update image path to be served as a URL
    const imageUrl = `http://localhost:3000/static/images/${this.imageFileName}`;

    return {
      licensePlate: 'ABC123',
      parkingBay: 'G01',
      parkingFloor: 'GROUND',
      image: imageUrl, // Path to access image via URL
    };
  }
}
